import React from 'react'
import { View , StyleSheet , Text } from 'react-native'
import Title from '../Components/ui/Title'

const GameOverScreen = () => {
  return (
    <View>
      <Title > 
      Game Over Screen
      </Title>
    </View>
  )
}

export default GameOverScreen
